import './App.css';

function App() {
  return (
    <div className='col-md-6 col-xs-12 cover-right'>
      <form name='form'>
        <header className="App-header">
          <div className="input-group">
            <input type="text" id="name" className="form-control" placeholder="Product name" />
            <input type="text" id="description" className="form-control" placeholder="Product desctiption" />
            <input type="text" id="price" className="form-control" placeholder="Product price" />
            <input type="text" id="name" className="form-control" placeholder="Product name" />
          </div>
        </header>
      </form>
    </div>
  );
}

export default App;
